/**
 * Stored in R8 format. Load it in the following format:
 *  - DX9:  D3DFMT_L8 
 *  - DX10: DXGI_FORMAT_R8_UNORM
 */
namespace PixelFarm.DrawingGL
{
    static class SMAAAreaTex
    {

        internal const int AREATEX_WIDTH = 160;
        internal const int AREATEX_HEIGHT = 560;
        internal const int AREATEX_PITCH = AREATEX_WIDTH;
        internal const int AREATEX_SIZE = (AREATEX_HEIGHT * AREATEX_PITCH);

        /**
        * Stored in R8G8 format. Load it in the following format:
        *  - DX9:  D3DFMT_A8L8 
        *  - DX10: DXGI_FORMAT_R8G8_UNORM
        */

        //original arrray buffer in base64 encoded
        const string areaTextStringRG = "";

        const string areaTextRGB24 = "";

        //internal static readonly byte[] areaTexBytes = System.Convert.FromBase64String(areaTextString);
        internal static readonly byte[] areaTexBytes = System.Convert.FromBase64String(areaTextStringRG);

    }
}